import { reqAddressInfo,reqOrderInfo } from "@/api";
const state = {};
const mutations = {};
const actions = {

    async getUserAddress({commit}){
       let result = reqAddressInfo()
        if(result.code == 200){
            commit('GETUSERADDRESS',result.data)
        }
    }
};
const getters = {};

export default{
    state,
    mutations,
    actions,
    getters
}
